in_source: |-
  (deproc prob1 (bound)
      (set sum 0)
      (set i 0)
      (loop (< i bound)
          (if (= (% i 3) 0)
              (set sum (+ sum i))
          )
          (if (and (= (% i 5) 0) (!= (% i 3) 0))
              (set sum (+ sum i))
          )
          (set i (+ i 1))
      )
      (print_int sum)
  )
  (prob1 1000)
